/* Footer Used Across Pages -- See Index.css*/
// Bootstrap Elements
import { Container, Row, Col, ListGroup } from 'react-bootstrap';
// Social Media Icons
import GitHub from '../../img/socials/github.png';
import LinkedIn from '../../img/socials/linkedin.png';
import Instagram from '../../img/socials'

const Footer = () => {
    return (
        <div className="Footer">
            <Container>
                <Row>
                    <ListGroup horizontal className="justify-content-center">
                        <ListGroup.Item>
                            <a href="https://github.com/SamuelAdamson" target="_blank" rel="noreferrer"> 
                                <img src={ GitHub } height="48" width="48" alt="Instagram"/>
                            </a>
                        </ListGroup.Item>
                    </ListGroup>
                </Row>
            </Container>
        </div>
    );
}

export default Footer;
